import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import './App.css';
import './components/Home.css';
import NavBar from './components/NavBar';
import RecordedFootageDetection from './components/RecordedFootageDetection';

function Home() {
  return (
    <div className="container">
      <header className="header">
        <h1>Traffic Anomaly Detection System</h1>
        <p>Real-time monitoring and analysis for safer roads and efficient traffic management.</p>
      </header>
      <section className="boxes">
        <div className="box">
          <h3>Live Traffic Monitoring</h3>
          <p>Continuously monitor traffic flow and detect anomalies such as wrong-way driving and prohibited area violations.</p>
        </div>
        <div className="box">
          <h3>Recorded Footage Analysis</h3>
          <p>Upload and analyze recorded video footage to identify traffic incidents and improve safety measures.</p>
        </div>
        <div className="box">
          <h3>Customizable Detection Models</h3>
          <p>Choose from multiple detection models or customize your own to suit specific traffic monitoring needs.</p>
        </div>
      </section>
    </div>
  );
}

function App() {
  return (
    <Router>
      <NavBar />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/recorded-detect" element={<RecordedFootageDetection />} />
      </Routes>
    </Router>
  );
}

export default App;
